//index.js
//获取应用实例
var app = getApp()

Page({
  data: {
    motto: 'Copyright@一个不愿意透露姓名的小组',
    userInfo: {},
    hasUserInfo: false,
    canIUse: wx.canIUse('button.open-type.getUserInfo'),
    academy: null,
    number: null,
    name: null,
    me_jpg: "data:image/jpg;base64,"
  },

  onLoad: function() {
    if (app.globalData.userdata['type'] === "admin") {
      this.setData({
        userType: 1,
      })
    } else {
      this.setData({
        userType: 0,
      })
    }
    if (app.globalData.userInfo) {
      this.setData({
        userInfo: app.globalData.userInfo,
        hasUserInfo: true,
        number: app.globalData.userdata['username'],
        academy: app.globalData.userdata['academy'],
        name: app.globalData.userdata['name']
      })
    } else if (this.data.canIUse) {
      // 由于 getUserInfo 是网络请求，可能会在 Page.onLoad 之后才返回
      // 所以此处加入 callback 以防止这种情况
      app.userInfoReadyCallback = res => {
        this.setData({
          userInfo: res.userInfo,
          hasUserInfo: true
        })
      }
    } else {
      // 在没有 open-type=getUserInfo 版本的兼容处理
      wx.getUserInfo({
        success: res => {
          app.globalData.userInfo = res.userInfo
          this.setData({
            userInfo: res.userInfo,
            hasUserInfo: true
          })
        }
      })
    }
  },
  getUserInfo: function(e) {
    console.log(e)
    app.globalData.userInfo = e.detail.userInfo
    this.setData({
      userInfo: e.detail.userInfo,
      hasUserInfo: true
    })
  },

  quit: function() {
    wx.setStorageSync('judge', false)
    wx.redirectTo({
      url: '/pages/login/login',
    })
  },
  // 致谢与说明
  thank: function() {
    wx.showModal({
      title: '致谢与说明',
      content: '感谢您使用讯必达，本程序由瓜大学生自主开发，与瓜大官方无任何联系，我们会保证各位同学翱翔门户信息的安全，请放心使用',
      showCancel: false,
      confirmText: '我知道了'
    })
  },
  // 意见反馈
  advice: function() {

  },
  // 赞赏支持
  like: function() {
    wx.previewImage({
      urls: ['http://m.qpic.cn/psc?/V131eGJV0Rbc0U/oAv0ZhR90Wmp6IConimKSNkIC4127ILRri2jb57gVAA5Q65z9axK5PFl8hb0j54ZzKTqHKt.hWGD9VVkn*RJHAIO*rGxAEojgNNA5htc.Bg!/b&bo=egJ8AnoCfAIDGTw!&rf=viewer_4&t=5'],
    })
  },
  // 分享
  onShareAppMessage: function() {
    return {
      title: '将讯必达分享给朋友',
      path: '/pages/login/login',
      imageUrl: '/pages/images/title.png'
    }
  }
})